import React from 'react'
import { Link } from 'react-router-dom'

export default function navbar() {
  return (
    <div>
        <Link to='{/Spped}'>Speed</Link>
        <Link to='Demo'>Demo</Link>
        <Link to='Explorer'>explorer</Link>
    </div>
  )
}
